import logo from "./logo.svg";
import "./App.css";
import { Component } from "react";

class App extends Component {
  constructor() {
    super(); /* Calls constructor of class you are extending i.e Component*/
    this.state = {
      monsters: [
        {
          name: "Linda",
          id: "31476",
        },
        {
          name: "Frank",
          id: "345e3",
        },
        {
          name: "Jacky",
          id: "1231e",
        },
        {
          name: "Andrei",
          id: "12e1e213",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return (
            <div key={monster.id}>
              <h1>{monster.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
